function whatIsInAName(collection, source) {
  // What's in a name?
  // 47 minutes, 28 seconds
  let arr = [];
  let srcKey = Object.keys(source);
  let srcValues = Object.values(source); 

  let keyCount = 0; 

  collection.filter(function(obj, index){

      var objKey = Object.keys(obj);
      var objValues = Object.values(obj);

    for(var j in objKey){

        if(!obj.hasOwnProperty(srcKey[j]))
        {
          keyCount = 0;
          //console.log(srcCount);
        }

        if(obj.hasOwnProperty(srcKey[j]) 
        && objValues[j] == srcValues[j])
        {
          keyCount++;
        }

        if(keyCount === srcKey.length 
        || srcKey.length === 1 && objValues[j] == srcValues)
        {
          arr.push(obj);
          keyCount = 0;
        }
    }
  })

  return arr;
}

whatIsInAName([{ first: "Romeo", last: "Montague" }, { first: "Mercutio", last: null }, { first: "Tybalt", last: "Capulet" }], { last: "Capulet" });
